import React from 'react';
import { Link } from 'react-router-dom';


function Posts(props) {
  const { posts, handleDelete, currentUser } = props;

  return (
    <div>
    <h3>Posts</h3>
      {
        posts.map(food => (
          <React.Fragment key={post.id}>
           <h1>{post.content}</h1>

          </React.Fragment>
        ))
      }
      <br />
    </div>
  );
}

export default Posts;
